public class ClassDecl extends Declaration {

  public ClassDecl(String cn, FieldDeclList fdl, MethodDeclList mdl, SourcePosition posn) {
	  super(cn, null, posn);
	  fieldDeclList = fdl;
	  methodDeclList = mdl;
  }

  public <A,R> R visit(Visitor<A, R> v, A o) {
      return v.visitClassDecl(this, o);
